import React from 'react';

const Section = ({children, title, module}) => {

  console.log({module})
  return (
    <section className={module == true ? 'box-section' : 'section'}>
      {title ? (
        <div className='section-header'>
          <h2 className='section-title'>{title}</h2>
        </div>
      ) : null}
      {children}
    </section>
  );
};

export default Section;
